import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import AboutImg from "../assects/about-us.jpg";

function About (){
    return(
        <>
        <Navbar/>
        <Hero
            cName=".hero-mid"
            heroImg={AboutImg}
            title="Your Journey Your Story"
            


        />
        </>
    )
}

export default About;
